define('front/editor/components/blocks/Footer/Footer.js',eval.call(null,"(function(){var exports={},module={exports:false};\nrequire(\"front/editor/components/blocks/Footer/Footer.tea\");\r\n\r\nconst {Block,Text,Logo,BlockColor,Switch,Dialog} = require(\"front/editor/components/internal/index.js\");\r\n\r\nclass Footer extends Block {\r\n\r\n    static get title() { return _t('Footer') }\r\n    static get description() { return _t('The final block') }\r\n\r\n    configForm() {\r\n        return html`\r\n            <${Dialog}>\r\n                <${Switch} name=\"show_policy\" label=\"${_t(\"Show policy\")}\" showWhen=${{variant:[1]}} />\r\n                <label value=${_t(\"Background color:\")} />\r\n                <${BlockColor} name=\"background_color\" />\r\n            <//>\r\n        `;\r\n    }\r\n\r\n    tpl_1(val) {\r\n        return html`\r\n        <div class=\"container-fluid footer footer_1\" style=\"background: ${val.background_color}\">\r\n            <div class=\"container\">\r\n                <div class=\"row\">\r\n                    <div class=\"col-3\">\r\n                        <${Logo} name=\"logo\" />\r\n                    </div>\r\n                    <div class=\"col-4\">\r\n                        <div class=\"desc\">\r\n                            <${Text} name=\"desc\" options=${Text.default_text} />\r\n                        </div>\r\n                        ${ val.show_policy && html`\r\n                            <div class=\"policy_wrap\">\r\n                                <a class=\"policy\" href=\"#\" onClick=${(e)=>{e.preventDefault();this.policyDialog.open()}}>${_t(\"Information policy\")}</a>\r\n                                <${Dialog} ref=${(r)=>this.policyDialog=r} class=\"policy_dialog\" scrollable=${true} overlayColor=\"rgba(0,0,0,0.5)\">\r\n                                    <div class=\"policy_info\">\r\n                                        <${Text} name=\"policy_info\" options=${Text.size_text} />\r\n                                    </div>\r\n                                <//>   \r\n                            </div>\r\n                        `}\r\n                    </div>\r\n                    <div class=\"col-4 before-1\">\r\n                        <div class=\"phone\">\r\n                            <${Text} name=\"phone\" options=${Text.default_heading} />\r\n                        </div>\r\n                        <div class=\"phone_desc\">\r\n                            <${Text} name=\"phone_desc\" options=${Text.default_text} />\r\n                        </div>\r\n                    </div>\r\n                </div>              \r\n            </div>\r\n        </div>\r\n    `\r\n    }\r\n\r\n    tpl_default_1() {\r\n        return config.language == 'en' ? {\r\n            'show_policy': true,\r\n            'background_color': '#FFFFFF',\r\n            'logo': {...Logo.tpl_default(), 'size': 87 },\r\n            'desc': \"The best circus «One and the same are at the circus ring»,<br>Moscow, Color Blvd., 13\",\r\n            'phone': '+7 (495) 321-46-98',\r\n            'phone_desc': 'Free call from Venus',\r\n            'policy_info': `\r\n                <h2>Privacy Policy</h2>\r\n                <p>This privacy policy discloses the privacy practices for lpcandy.ru. This privacy policy applies solely to information collected by this web site.</p>\r\n                <p>It will notify you of the following:</p>\r\n                <ul>\r\n                <li>What personally identifiable information is collected from you through the web site, how it is used and with whom it may be shared.</li>\r\n                <li>What choices are available to you regarding the use of your data.</li>\r\n                <li>The security procedures in place to protect the misuse of your information.</li>\r\n                </ul>\r\n                <p>How you can correct any inaccuracies in the information.</p>\r\n                <h3>Information Collection, Use, and Sharing</h3>\r\n                <p>We are the sole owners of the information collected on this site. We only have access to/collect information that you voluntarily give us via email or other direct contact from you. We will not sell or rent this information to anyone.</p>\r\n                <p>We will use your information to respond to you, regarding the reason you contacted us. We will not share your information with any third party outside of our organization, other than as necessary to fulfill your request, e.g. to ship an order.</p>\r\n                <p>Unless you ask us not to, we may contact you via email in the future to tell you about specials, new products or services, or changes to this privacy policy.</p>\r\n                <h3>Your Access to and Control Over Information</h3> \r\n                <p>You may opt out of any future contacts from us at any time. You can do the following at any time by contacting us via the email address or phone number given on our website:<p>\r\n                <ul>\r\n                <li>See what data we have about you, if any.</li>\r\n                    <li>Change/correct any data we have about you.</li>\r\n                <li>Have us delete any data we have about you.</li>\r\n                <li>Express any concern you have about our use of your data.</li>\r\n                </ul>\r\n                <h3>Security</h3> \r\n                <p>We take precautions to protect your information. When you submit sensitive information via the website, your information is protected both online and offline.</p>\r\n                <p>Wherever we collect sensitive information (such as credit card data), that information is encrypted and transmitted to us in a secure way. You can verify this by looking for a closed lock icon at the bottom of your web browser, or looking for \"https\" at the beginning of the address of the web page.</p>\r\n                <p>While we use encryption to protect sensitive information transmitted online, we also protect your information offline. Only employees who need the information to perform a specific job (for example, billing or customer service) are granted access to personally identifiable information. The computers/servers in which we store personally identifiable information are kept in a secure environment.</p>\r\n                <h3>Updates</h3>\r\n                <p>Our Privacy Policy may change from time to time and all updates will be posted on this page.</p>\r\n                <p>If you feel that we are not abiding by this privacy policy, you should contact us immediately via email.</p>\r\n            `,\r\n        } : {\r\n            'show_policy': true,\r\n            'background_color': '#FFFFFF',\r\n            'logo': {...Logo.tpl_default(), 'size': 87 },\r\n            'desc': \"Лучший цирк «НА МАНЕЖЕ ВСЕ ТЕ ЖЕ»,<br>г.Москва, Цветной бульвар, 13\",\r\n            'phone': '+7 (495) 321-46-98',\r\n            'phone_desc': 'Звонок с Венеры бесплатный',\r\n            'policy_info': `\r\n                <h2>ПОЛИТИКА КОНФИДЕНЦИАЛЬНОСТИ</h2>\r\n                <p>Соблюдение Вашей конфиденциальности важно для нас. По этой причине, мы разработали Политику Конфиденциальности, которая описывает, как мы используем и храним Вашу информацию. Пожалуйста, ознакомьтесь с нашими правилами соблюдения конфиденциальности и сообщите нам, если у вас возникнут какие-либо вопросы.</p>\r\n                <h3>Сбор и использование персональной информации</h3>\r\n                <p>Под персональной информацией понимаются данные, которые могут быть использованы для идентификации определенного лица либо связи с ним.</p>\r\n                <p>От вас может быть запрошено предоставление вашей персональной информации в любой момент, когда вы связываетесь с нами. </p>\r\n                <p>Ниже приведены некоторые примеры типов персональной информации, которую мы можем собирать, и как мы можем использовать такую информацию.</p>\r\n                <h4>Какую персональную информацию мы собираем</h4>\r\n                <ul>\r\n                <li>Когда вы оставляете заявку на сайте, мы можем собирать различную информацию, включая ваши имя, номер телефона, адрес электронной почты и т.д.</li>\r\n                </ul>\r\n                <h4>Как мы используем вашу персональную информацию</h4>\r\n                <ul>\r\n                <li>Собираемая нами персональная информация позволяет нам связываться с вами и сообщать об уникальных предложениях, акциях и других мероприятиях и ближайших событиях. </li>\r\n                <li>Время от времени, мы можем использовать вашу персональную информацию для отправки важных уведомлений и сообщений. </li>\r\n                <li>Мы также можем использовать персональную информацию для внутренних целей, таких как проведения аудита, анализа данных и различных исследований в целях улучшения услуг предоставляемых нами и предоставления Вам рекомендаций относительно наших услуг.</li>\r\n                <li>Если вы принимаете участие в розыгрыше призов, конкурсе или сходном стимулирующем мероприятии, мы можем использовать предоставляемую вами информацию для управления такими программами.</li>\r\n                </ul>\r\n                <h3>Раскрытие информации третьим лицам</h3>\r\n                <p>Мы не раскрываем полученную от Вас информацию третьим лицам. </p>\r\n                <h4>Исключения</h4>\r\n                <p>В случае если необходимо — в соответствии с законом, судебным порядком, в судебном разбирательстве, и/или на основании публичных запросов или запросов от государственных органов на территории РФ — раскрыть вашу персональную информацию. Мы также можем раскрывать информацию о вас если мы определим, что такое раскрытие необходимо или уместно в целях безопасности, поддержания правопорядка, или иных общественно важных случаях.</p>\r\n                <p>В случае реорганизации, слияния или продажи мы можем передать собираемую нами персональную информацию соответствующему третьему лицу – правопреемнику.</p>\r\n                <h3>Защита персональной информации</h3>\r\n                <p>Мы предпринимаем меры предосторожности — включая административные, технические и физические — для защиты вашей персональной информации от утраты, кражи, и недобросовестного использования, а также от несанкционированного доступа, раскрытия, изменения и уничтожения.</p>\r\n                <h3>Соблюдение вашей конфиденциальности на уровне компании</h3>\r\n                <p>Для того чтобы убедиться, что ваша персональная информация находится в безопасности, мы доводим нормы соблюдения конфиденциальности и безопасности до наших сотрудников, и строго следим за исполнением мер соблюдения конфиденциальности.</p>\r\n            `,\r\n        }\r\n    }\r\n}\r\n\r\nBlock.register('Footer',exports = Footer);\r\n\nreturn module.exports || exports;})\n//# sourceURL=bergamot://bundle/front/editor/components/blocks/Footer/Footer.js"))
define('front/editor/components/blocks/Footer/Footer.tea',()=>true)

define('front/editor/components/blocks/Video/Video.js',eval.call(null,"(function(){var exports={},module={exports:false};\nrequire(\"front/editor/components/blocks/Video/Video.tea\");\r\n\r\nconst {Block,Repeater,Text,Media,Radio,BlockColor,Switch,Dialog} = require(\"front/editor/components/internal/index.js\"); \r\n\r\nclass Video extends Block {\r\n\r\n    static get title() { return _t('Video') }\r\n    static get description() { return _t('Add video') }\r\n\r\n    configForm() {\r\n        var val = this.value;\r\n        return html`\r\n            <${Dialog}>\r\n                <${Switch} name=\"show_title\" label=\"${_t(\"Show first title\")}\" showWhen=${{variant:[1, 3]}} />\r\n                <${Switch} name=\"show_title_2\" label=\"${_t(\"Show second title\")}\" showWhen=${{variant:[1, 3]}} /> \r\n                <${Switch} name=\"show_text_title_2\" label=\"${_t(\"Show second text title\")}\" showWhen=${{variant:[2]}} />\r\n                <${Switch} name=\"show_desc\" label=\"${_t(\"Show description\")}\" showWhen=${{variant:[3]}} /> \r\n                <${Switch} name=\"show_border\" label=\"${_t(\"Show border\")}\" showWhen=${{variant:[3]}} /> \r\n                ${val.variant == 1 && html`<label>${_t(\"Video size:\")}</label>`} \r\n                <${Radio} name=\"video_size\" inline=${false} items=${[\r\n                    {label: _t(\"small\"), value:\"small\"},\r\n                    {label: _t(\"medium\"), value:\"medium\"},\r\n                    {label: _t(\"large\"), value:\"large\"},\r\n                ]} showWhen=${{variant: [1]}} />\r\n                <label>${_t('Background:')}</label>\r\n                <${BlockColor} name=\"background_color\" />\r\n            <//>\r\n        `;\r\n    }\r\n\r\n    tpl_1(val) {\r\n        return html`<div class=\"container-fluid video_block video_block_1\" style=\"background: ${val.background_color};\">\r\n            <div class=\"container\">\r\n                <div class=\"row\">\r\n                    <div class=\"col-12\">\r\n                        ${val.show_title && html`\r\n                            <h1 class=\"title\"> \r\n                                <${Text} name=\"title\" options=${Text.plain_heading}/>\r\n                            </h1>\r\n                        `}\r\n                        ${val.show_title_2 && html`\r\n                            <div class=\"title_2\"> \r\n                                <${Text} name=\"title_2\" options=${Text.plain_heading}/>\r\n                            </div>\r\n                        `}\r\n                        <div class=\"video ${val.video_size || 'small'}\">  \r\n                             <${Media} name=\"video\" switchType=${false}/>\r\n                        </div>\r\n                    </div>\r\n                </div>\r\n            </div>\r\n        </div>`\r\n    }\r\n\r\n    tpl_default_1() { \r\n        return config.language == 'en' ? {\r\n            video_size: \"small\",\r\n            show_title: true,\r\n            show_title_2: false,\r\n            background_color: '#FFFFFF',\r\n            title: 'Watch our video',\r\n            title_2: 'Subtitle',\r\n            video: {video_url: 'www.youtube.com/embed/slMub4NtrSk', type: 'video'},\r\n        } : {\r\n            video_size: \"small\",\r\n            show_title: true,\r\n            show_title_2: false,\r\n            background_color: '#FFFFFF',\r\n            title: 'Посмотрите видео о нашем цирке',\r\n            title_2: 'Нарезка выступлений',\r\n            video: {video_url: 'www.youtube.com/embed/slMub4NtrSk', type: 'video'},\r\n        }\r\n    }\r\n\r\n    tpl_2(val) {   \r\n        return  html`<div class=\"container-fluid video_block video_block_2\" style=\"background: ${val.background_color};\">\r\n                <div class=\"container\">\r\n                    <div class=\"row\">\r\n                        <div class=\"item_list col-12\">\r\n                            <${Repeater} name=\"items\">\r\n                                ${(item_val, self) => html`\r\n                                    <div class=\"item row\">\r\n                                        ${val.items.map (item => html`\r\n                                            <div class=\"video col-6\">\r\n                                                <${Media} name=\"video\" switchType=${false} />\r\n                                            </div>\r\n                                            <div class=\"text_wrap col-6\"> \r\n                                                    <h1 class=\"text_title\"> \r\n                                                        <${Text} name=\"text_title\" options=${Text.plain_heading}/>\r\n                                                    </h1> \r\n                                                    ${val.show_text_title_2 && html`\r\n                                                        <div class=\"text_title_2\"> \r\n                                                            <${Text} name=\"text_title_2\" options=${Text.plain_heading}/>\r\n                                                        </div>\r\n                                                    `} \r\n                                                <div class=\"text\"> \r\n                                                    <${Text} name=\"text\" options=${Text.plain_heading}/>\r\n                                                </div>\r\n                                            </div>\r\n                                        `)}\r\n                                    </div>\r\n                                `}\r\n                            <//>\r\n                        </div>\r\n                    </div>                \r\n                </div>\r\n            </div>`\r\n   }\r\n    \r\n    tpl_default_2() {\r\n        return config.language == 'en' ? {\r\n            show_text_title_2: true,\r\n            background_color: '#FFFFFF',\r\n            items: [\r\n                    {\r\n                        text_title: 'Circus «One and the same are at the circus ring»',\r\n                        text_title_2: 'The best circus program',\r\n                        text: `<div>Meeting with the clown duo, reprises which are built in the modern spirit, and do not leave indifferent neither kids nor adults. The stunts of the gymnast on the trapeze under the dome of our circus take your breath away.</div>\r\n                                <br>\r\n                                <div>\r\n                                -Comfortable hall <br>\r\n                                -Funny acts <br>\r\n                                -Exciting performances <br>\r\n                                </div>`,\r\n                        video: {video_url: 'www.youtube.com/embed/slMub4NtrSk', type: 'video'}\r\n                    },  \r\n                ],\r\n        } : {\r\n            show_text_title_2: true,\r\n            background_color: '#FFFFFF',\r\n            items: [\r\n                    {\r\n                        text_title: 'Цирк «НА МАНЕЖЕ ВСЕ ТЕ ЖЕ»',\r\n                        text_title_2: 'Лучшая цирковая программа',\r\n                        text: `<div>Встреча с клоунскими дуэтами, репризы которых построены в современном духе и не оставляют равнодушными ни детей, ни взрослых. Под куполом цирка воздушная гимнастка на трапеции, отважные трюки которой захватывают дыхание.</div>\r\n                                <br>\r\n                                <div>\r\n                                -Комфортный зал <br>\r\n                                -Смешные номера <br>\r\n                                -Захватывающие выступления <br>\r\n                                </div>`,\r\n                        video: {video_url: 'www.youtube.com/embed/slMub4NtrSk', type: 'video'},\r\n                    },\r\n                ],\r\n        };\r\n    }\r\n\r\n    tpl_3(val) {  \r\n        return html`<div class=\"container-fluid video_block video_block_3\" style=\"background: ${val.background_color};\">\r\n            <div class=\"container\">\r\n                <div class=\"row\">\r\n                    <div class=\"col-12\">\r\n                        ${val.show_title && html`\r\n                            <h1 class=\"title\"> \r\n                                <${Text} name=\"title\" options=${Text.plain_heading}/>\r\n                            </h1>\r\n                        `}\r\n                        ${val.show_title_2 && html`\r\n                            <div class=\"title_2\"> \r\n                                <${Text} name=\"title_2\" options=${Text.plain_heading}/>\r\n                            </div>\r\n                        `}                    \r\n                        <div class=\"item_list clear\">\r\n                            <${Repeater} name=\"items\">\r\n                                ${(item_val, self) => html`\r\n                                    <div class=\"row\"> \r\n                                        ${[1, 2, 3].map (i => html` \r\n                                            <div class=\"item col-4\"> \r\n                                                <div class=\"video ${!val.show_border ? 'hide_border' : ''}\">\r\n                                                    <${Media} name=\"video_${i}\" switchType=${false}/>\r\n                                                </div>\r\n                                                <div class=\"info\">\r\n                                                    <div class=\"name\">\r\n                                                        <${Text} name=\"name_${i}\" options=${Text.plain_heading}/>\r\n                                                    </div>\r\n                                                    ${val.show_desc && html`\r\n                                                        <div class=\"desc\">\r\n                                                            <${Text} name=\"desc_${i}\" options=${Text.plain_heading}/>\r\n                                                        </div>\r\n                                                    `} \r\n                                                </div>\r\n                                            </div> \r\n                                        `)}\r\n                                    </div>\r\n                                `}\r\n                            <//>                      \r\n                        </div>\r\n                    </div>\r\n                </div>                \r\n            </div>\r\n        </div>`\r\n    }\r\n    \r\n    tpl_default_3() { \r\n        return config.language == 'en' ? {\r\n            show_title: true,\r\n            show_title_2: false,\r\n            show_border: true,\r\n            show_desc: true,   \r\n            background_color: '#FFFFFF',\r\n            title: 'Testimonials',\r\n            title_2: 'Subtitle', \r\n            items: [\r\n                {\r\n                    name_1: 'Service phone',\r\n                    desc_1: 'Sergei Zaduysvechku, office plankton',\r\n                    video_1: {video_url: 'www.youtube.com/embed/slMub4NtrSk', type: 'video'}, \r\n                    name_2: 'Pushing paper',\r\n                    desc_2: 'Alina Seshsalo, chairman of the meeting',\r\n                    video_2: {video_url: 'www.youtube.com/embed/slMub4NtrSk', type: 'video'}, \r\n                    name_3: 'Clearing',\r\n                    desc_3: 'Ivan Zaveditraktor, navigator of combine',\r\n                    video_3: {video_url: 'www.youtube.com/embed/slMub4NtrSk', type: 'video'}, \r\n                }\r\n            ]\r\n                \r\n        } : {\r\n            show_title: true,\r\n            show_title_2: false,\r\n            show_border: true,\r\n            show_desc: true,   \r\n            background_color: '#FFFFFF',\r\n            title: 'Отзывы о цирковой программе',\r\n            title_2: 'Что понравилось нашим клиентам', \r\n            items:[\r\n                {\r\n                    name_1: 'Обслуживание телефонов',\r\n                    desc_1: 'Сергей Задуйсвечку, офисный планктон',\r\n                    video_1: {video_url: 'www.youtube.com/embed/slMub4NtrSk', type: 'video'}, \r\n                    name_2: 'Перекладывание бумаг',\r\n                    desc_2: 'Алина Съешсало, председатель заседаний',\r\n                    video_2: {video_url: 'www.youtube.com/embed/slMub4NtrSk', type: 'video'}, \r\n                    name_3: 'Освоение целины',\r\n                    desc_3: 'Иван Заведитрактор, штурман комбайна',\r\n                    video_3: {video_url: 'www.youtube.com/embed/slMub4NtrSk', type: 'video'}, \r\n                }\r\n            ]\r\n        };       \r\n    }\r\n}\r\n\r\nBlock.register('Video',exports = Video);\nreturn module.exports || exports;})\n//# sourceURL=bergamot://bundle/front/editor/components/blocks/Video/Video.js"))
